import React from "react";
import ReactDOM from "react-dom";
import { App } from "./app";
import "./styles/styles.css";
import { Auth0Provider } from "@auth0/auth0-react";
import { BrowserRouter, createBrowserRouter, RouterProvider } from "react-router-dom";
import { AdminPage } from "./pages/admin-page";
import { HomePage } from "./pages/home-page";
import { NotFoundPage } from "./pages/not-found-page";
import { ProfilePage } from "./pages/profile-page";
import { ProtectedPage } from "./pages/protected-page";
import { PublicPage } from "./pages/public-page";

const router = createBrowserRouter([
  {
    path: navRoutes.root,
    element: <Common setTheme={setTheme} />,
    children: [
      { element: <Navigate to={navRoutes.home} />, index: true },
      { path: navRoutes.home, element: <HomePage /> },
      { path: navRoutes.island, element: <IslandPage /> },
      { path: navRoutes.settings, element: <div>settings</div> },

      { element: <Navigate to={"/"} />, index: true, },
      { path: "/", element: <HomePage />, },
      { path: "/profile", element: <ProfilePage /> },
      { path: "/public", element: <PublicPage /> },
      { path: "/protected", element: <ProtectedPage /> },
      { path: "/admin", element: <AdminPage /> },
      { path: "*", element: <NotFoundPage /> },
    ],
  },
  { path: "/", element: <HomePage />, },
  { path: "/profile", element: <ProfilePage /> },
  { path: "/public", element: <PublicPage /> },
  { path: "/protected", element: <ProtectedPage /> },
  { path: "/admin", element: <AdminPage /> },
  { path: "*", element: <NotFoundPage /> },
  // not found(404)
  { path: "*", element: <div>Not found</div> },
]);

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Auth0Provider>
        <RouterProvider router={router} >
          <App />
        </RouterProvider>
      </Auth0Provider>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
